import * as S from "./styles";

const Header = () => {
  return (
    <S.Header>
      <p>Reabciuc Daria-Brianna</p>
      <div className="navbar">
        <ul>
          <li>About</li>
          <li>Contact</li>
        </ul>
      </div>
    </S.Header>
  );
};

export default Header;
